def paint_fence(n, k):
    if n == 0:
        return 0
    if n == 1:
        return k

    dp = [[0] * k for _ in range(n)]

    for i in range(k):
        dp[0][i] = 1  # First post can be any color

    for i in range(1, n):
        for j in range(k):
            # Case 1: Current post has a different color than the previous post
            dp[i][j] += dp[i - 1][(j - 1) % k]

            # Case 2: Current post has the same color as the post before the previous post
            if i >= 2:
                dp[i][j] += dp[i - 2][j]

    total_ways = 0
    for j in range(k):
        total_ways += dp[n - 1][j]

    return total_ways

